webpackJsonp([0xe7a325bf5f03],{1102:function(e,s){e.exports={data:{package:{id:"unpublished/af/bs-d3",score:0,name:"af/bs-d3",version:"0.1.0",description:"Experimental d3 4.x bindings for BuckleScript",keywords:["dataviz","d3.js","bucklescript"],license:"MIT",updated:"2018-01-06T01:09:11.527Z",stars:7,type:"unpublished",quality:0,popularity:0,maintenance:0,readme:'<h1>bs-d3</h1>\n<p>WIP <a href="https://github.com/d3/d3">d3</a> 4.x bindings for <a href="https://github.com/bucklescript/bucklescript/">Bucklescript</a>.</p>\n<p>Extremely incomplete and experimental; contributions welcome!</p>\n<h2>Build</h2>\n<pre><code>npm run build\n</code></pre>\n<h2>Build + Watch</h2>\n<pre><code>npm run start\n</code></pre>\n<h2>Current status</h2>\n<p>d3 has a large <a href="https://github.com/d3/d3/blob/master/API.md#paths-d3-path">API surface</a>, so there\'s still a lot to do! However, the pieces are already in place to <a href="https://github.com/af/bs-d3/blob/master/examples/lineChart.re">draw line and area charts</a></p>\n<p>Currently some of the typings are still quite loose/permissive, if you have any suggestions to tighten them up in an idiomatic OCaml way, please file an issue or PR.</p>\n<ul>\n<li class="task-list-item"><input type="checkbox" checked disabled> Axes</li>\n<li class="task-list-item"><input type="checkbox" checked disabled> Arrays (about 50%)</li>\n<li class="task-list-item"><input type="checkbox" disabled> Brushes</li>\n<li class="task-list-item"><input type="checkbox" disabled> Chords</li>\n<li class="task-list-item"><input type="checkbox" disabled> Brushes</li>\n<li class="task-list-item"><input type="checkbox" disabled> Collections</li>\n<li class="task-list-item"><input type="checkbox" disabled> Colors</li>\n<li class="task-list-item"><input type="checkbox" disabled> Dispatches</li>\n<li class="task-list-item"><input type="checkbox" disabled> Dragging</li>\n<li class="task-list-item"><input type="checkbox" disabled> Easings</li>\n<li class="task-list-item"><input type="checkbox" disabled> Forces</li>\n<li class="task-list-item"><input type="checkbox" disabled> Number formatting</li>\n<li class="task-list-item"><input type="checkbox" disabled> Geo</li>\n<li class="task-list-item"><input type="checkbox" disabled> Hierarchies</li>\n<li class="task-list-item"><input type="checkbox" disabled> Interpolators</li>\n<li class="task-list-item"><input type="checkbox" disabled> Paths</li>\n<li class="task-list-item"><input type="checkbox" disabled> Polygons</li>\n<li class="task-list-item"><input type="checkbox" disabled> Quadtrees</li>\n<li class="task-list-item"><input type="checkbox" checked disabled> Scales (partially)</li>\n<li class="task-list-item"><input type="checkbox" checked disabled> Selections (mostly)</li>\n<li class="task-list-item"><input type="checkbox" checked disabled> Shapes (lines &#x26; areas only at the moment)</li>\n<li class="task-list-item"><input type="checkbox" disabled> Time Intervals</li>\n<li class="task-list-item"><input type="checkbox" disabled> Timers</li>\n<li class="task-list-item"><input type="checkbox" disabled> Transitions</li>\n<li class="task-list-item"><input type="checkbox" disabled> Voronoi</li>\n<li class="task-list-item"><input type="checkbox" disabled> Zooming</li>\n</ul>\n<h2>Known Issues</h2>\n<p>When building this project for the first time, you\'ll get some "value x can\'t be found" errors in\nthe example files. Just re-build a couple of times and they\'ll be resolved automatically. If anyone\nknows why this happens, please file an issue or PR!</p>\n',homepageUrl:"https://github.com/af/bs-d3",repositoryUrl:"https://github.com/af/bs-d3",npmUrl:null,issuesUrl:"https://github.com/af/bs-d3/issues",slug:"packages/unpublished/af/bs-d3"}},pathContext:{id:"unpublished/af/bs-d3"}}}});
